(13296, 9309, 1446, 4, 'Overload', '', '2005-12-22 00:00:00', 0000, 20, 0, 7, '', 'overload, oh what a match we are!\nas we romance along\ntowards the firescape\nopen fire\nforever in your arms\nsplendid time we have\ndoing what i dread\noh my lord\ncan i buy some time\ni''m learning to dance\ndum-ditty-dance\ni''m dancing, ok?\n\noverlord, lord of the underworld\nfull-of-wonder-girl\nas we twist and twirl\nhot and dry\nhigh in my cloven heels\nthis is how real love feels\nas we prance and die\noh my lord\nsuch a fancy fire\nas we dance\nyou sure can dance\ndance dance\nyou i will never forget\ni hope you''ll remember me later\nwe''re swimming in a puddle of sweat\ni''m hot baby, don''t burn your fingers\ni''m tenderly served on your plate\nthe band must continue to play\nso we can dance\ni love to dance, baby dance with me\nyeah, i can dance\nto love is to dance\nnow dance me home', 199, '', '', '', '', '', '', 0, 1, 0, '2009-01-17 22:10:07', '2015-03-12 13:37:15', '0000-00-00 00:00:00'),
